const darkColor = "#262726"
const lightColor = "#eaeaea"
const accent = "#cba974";

const theme = {
    light: {
        bg: lightColor,
        color: darkColor,
        accent: accent,
    },
    dark: {
        background: darkColor,
        color: lightColor,
        accent: accent,
    }
}

export default theme
